import numpy as np

# we build some distributions and load them into a dict
mu, sigma = 0, 0.5
normal = np.random.normal(mu, sigma, 1000)
lognormal = np.random.lognormal(mu, sigma, 1000)
distributions = dict(normal=normal, lognormal=lognormal)

# then we create a pandas df from the dict
import pandas as pd
df = pd.DataFrame(distributions)
dfd = df.to_dict()
dfl = dfd.values()
dfa = np.array(dfl)

from bokeh.charts import DataObject
data = DataObject(dfl)

do = DataObject(dfa, force_alias=False)
do.keys()
